import React,{useState} from "react";
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import axios from "axios";
import Main from "./main";
import { Link, useNavigate } from "react-router-dom";
import { signupservice } from "../services/user";
import Signnav from "./signnav";


function Sign(){

  const [obj,updateobj]=useState({email:"",pwd:"",type:"type"});

  const nagivate=useNavigate();
  const update=(event)=>{
      var {name,value}=event.target;

      updateobj({...obj,[name]:value});
  }

  function check(){
        if(obj.type==="type")
        return false;
        if(obj.email==="")
        return false;
        if(obj.pwd==="")
        return false;
  }

  // const signupuserwithquery=async()=>{

  //     var url="http://localhost:2002/user/signup-user-post";
  //     var resp=await axios.post(url,obj);
  //     if(resp.data.status)
  //     {
  //       nagivate("/");
  //     }
  //     else
  //     {
  //       alert(resp.data.message);
  //     }
  // }

  const signupuserwithquery=async()=>{

      var resp=await signupservice(obj);
      if(resp.data.status)
      {
        nagivate("/");
      }
      else
      {
        alert(resp.data.message);
      }
  }

    return(
        <div>
          
          <Signnav></Signnav>

          <div></div>

          <center>

          <h1>
            Signup Here...
          </h1>
            <Form method="post" >
              <Form.Group as={Row} className="mb-3" controlId="formHorizontalEmail">
                <Form.Label column sm={2}>
                  Email
                </Form.Label>
                <Col sm={5}>
                  <Form.Control type="email" placeholder="Email" name="email" value={obj.email}  onChange={update}/>
                </Col>
              </Form.Group>
        
              <Form.Group as={Row} className="mb-3" controlId="formHorizontalPassword">
                <Form.Label column sm={2}>
                  Password
                </Form.Label>
                <Col sm={5}>
                  <Form.Control type="password" placeholder="Password" name="pwd" value={obj.pwd} onChange={update}/>
                </Col>
              </Form.Group>
              
              <Form.Group as={Row} className="mb-3" controlId="formHorizontalCheck">
              <Form.Label column sm={2}>
                  Select
                </Form.Label>
                <Col sm={5}>
                  <Form.Select aria-label="Default select example" name="type" value={obj.type} onChange={update}>
                    <option>Open this select menu</option>
                    <option value="Client">car-owner</option>
                    <option value="Service-Provider">parking-Provider</option>
                  </Form.Select>
                </Col>
              </Form.Group>

              <Link to="/login">
              <h4>Login</h4>
              </Link>
        
              <Form.Group as={Row} className="mb-3">
                <Col sm={{ span: 5, offset: 2 }}>
                  <Button type="button" onClick={signupuserwithquery}>Sign up</Button>
                </Col>
              </Form.Group>
            </Form>
            </center>
        </div>
    )
}

export default Sign;
